while (paramEnum.hasMoreElements())
{
	def param = paramEnum.nextElement()
	if(param.toString() == "access_token")
		p_access_token = param
	if(param.toString() == "limit")
		p_limit = mockRequest.httpRequest.getParameter("limit")
	if(param.toString() == "fields")
		p_fields = mockRequest.httpRequest.getParameter("fields")	
}

if (p_access_token == null)
	return "Return the message \"Token must be used...\""

if ((p_limit == null) && (p_fields == null))
	return "Successful response"

if (p_fields == null)
{
	if (p_limit == "1")
		return "Return 1 news"
	if (p_limit == "2")
		return "Return 2 news"	
	if (p_limit == "3")
		return "Return 3 news"	
}

if (p_limit == null)
{
	if (p_fields == "actions")
		return "Return the \"actions\" field"
	if (p_fields == "caption")
		return "Return the \"caption\" field"	
	if (p_fields == "icon")
		return "Return the \"icon\" field"	
}

